V8:
Bakı şəhəri,28 May küçəsi,Neftçilər xəstəxanasının arxasında,”Halal” MTK-da yerləşən,2 otaqlı və 4 otaqlı mənzillərin birgə layihəsi olan mənzil satılır.
Mənzilə aid məlumatlar aşağıdakılardır:
-bir hissəsi 28 May küçəsinə,bir hissəsi isə Bakı dəmiryol vağzalına baxır,Bakı bulvarına gözəl panoraması vardır;
-18 mərtəbəli binanın 17-ci mərtəbəsindədir;
-sahəsi 300 kv/m-dır;
-çıxarışlar vardır (2 ədəd);
-aşağı mərtəbədə (-1 də) 2 maşınlıq,çıxarışlı avtodayanacaq vardır;
-kamera müşahidə sistemi vardır;
-mühafizə sistemi quraşdırılmışdır;
-WIFI-UNIFI sistemi quraşdırılıb;
-otaqlara uyğun kondisioner sistemi quraşdırılmışdır;
-kombi sistemi quraşdırılmışdır.
Mənzildə olan otaqlar və onların sayı:
-1 iş otağı;
-4 yataq otağı;
-1 qarderob otağı;
-1 qonaq otağı;
-1 texniki otaq/camaşırxana;
-1 mətbəx-studiya;
-4 eyvan;
-4 san/qovşaq.
Mənzildə olan mebel və texnikalar:
-kombi “BIASI” (2 ədəd);
-kondisioner “DAIKIN” (7 ədəd);
-paltaryuyan maşın “BOSCH” (1 ədəd); 
-paltarqurudan maşın “BOSCH” (1 ədəd);
-tv “SONY” (6 ədəd)
-su filteri Amerika istehsalı “AMWAY”;
-stabilizator “ÇƏTİNKAYA” (2 ədəd);
-giriş qapısı İtaliya istehsalı “CISA”;
-laminat Alman istehsalı;
-yataq,otaq,uşaq mebelleri “DOĞTAŞ”,”YATSAN”;
-kabinet mebeli İtaliya istehsalı;
-bar stolu və mətbəx iş stolunun üst hissəsi tökmə mərmərdən;
-mətbəx mebeli Alman istehsalı;
-otaq qapıları türk istehsalı “KAHVECİ”;
-divar kağızları Avropa istehsalı;
-santexnika avadanlıqları İtaliya istehsalı;
-kafel-metlax,mərmər-qranit İspaniya istehsalı.
-mətbəx texnikaları “BOSCH”:
--qabyuyan maşın (1 ədəd)
--kofe maşını (1 ədəd)
--elekrik sobası (1 ədəd)
--qaz plitəsi (3 ədədli)
--aspirator (1 ədəd)
--soyuducular (2 ədəd)
Şatış qiyməti start olaraq 900.000 azn.
Əşyalar,texnikalar,mebellər və 2 maşınlıq avtodayanacaq qiymətə daxildir.
